import './Game.css';

const Game = ({showRowButtons, won, newGame}) => (
        <div>
            <div className="container">
                {showRowButtons(1)} 
                {showRowButtons(2)}
            </div>
            <div className="container">
              {won && <div>Bravo, <button onClick={()=>newGame()}>Rejouer</button></div>}
            </div>
        </div>
)


export default Game
